(234, 1, 4, 0, NULL, 'si', '2023-05-07', '2023-05-09', '2023-08-24', 'fisica aplicada', '<blockquote style=\"text-align: center;\"><u><b>Que es la Fisica Aplicada?</b></u></blockquote><p style=\"text-align: justify; \"><b style=\"color: rgb(32, 33, 34); font-size: 14px;\">Física aplicada</b><span style=\"color: rgb(32, 33, 34); font-size: 14px;\"> es un término genérico que indica la parte de la física que se interesa particularmente por el uso de </span><a href=\"https://es.wikipedia.org/wiki/Tecnolog%C3%ADas\" class=\"mw-redirect\" title=\"Tecnologías\" style=\"text-decoration: none; color: rgb(51, 102, 204); background: none rgb(255, 255, 255); overflow-wrap: break-word; font-family: sans-serif; font-size: 14px; font-weight: 400;\">tecnologías</a><span style=\"color: rgb(32, 33, 34); font-size: 14px;\">. \"Aplicada\" se distingue de \"pura\" mediante una sutil combinación de factores como la </span><a href=\"https://es.wikipedia.org/wiki/Utilidad_(econom%C3%ADa)\" title=\"Utilidad (economía)\" style=\"text-decoration: none; color: rgb(51, 102, 204); background: none rgb(255, 255, 255); overflow-wrap: break-word; font-family: sans-serif; font-size: 14px; font-weight: 400;\">motivación</a><span style=\"color: rgb(32, 33, 34); font-size: 14px;\"> de investigación, y la relación entre tecnología y </span><a href=\"https://es.wikipedia.org/wiki/Ciencia\" title=\"Ciencia\" style=\"text-decoration: none; color: rgb(51, 102, 204); background: none rgb(255, 255, 255); overflow-wrap: break-word; font-family: sans-serif; font-size: 14px; font-weight: 400;\">ciencia</a><span style=\"color: rgb(32, 33, 34); font-size: 14px;\">, </span><br></p><p></p>', '', '', 'normal', 'primary', 'general', 'completo', 0, ''),
