(1332, 317, '<p>Hola Lalo, dejo el <a href=\"http://148.207.218.46/tecnologia/mod/h5pactivity/view.php?id=1376\" target=\"_blank\">recurso</a> para su cotejo y <a href=\"https://drive.google.com/file/d/1OQfr2LlEzB35uzMguo1Bxk50Lq1X3Gmz/view?usp=drive_link\" target=\"_blank\">PDF</a> para comentarios.</p><p>Como comentario, en el guion se pide que el siguiente texto, se ponga en negritas:</p><p>\"<span style=\"text-align: var(--bs-body-text-align);\">Toma en cuenta que este es un ejercicio de refuerzo que no se evaluará ni impactará en tu promedio final de la semana. Puedes realizar los intentos que quieras</span><span style=\"text-align: var(--bs-body-text-align);\">.\"</span></p><p>Sin embargo en recursos similares (<a href=\"http://148.207.218.46/tecnologia/mod/h5pactivity/view.php?id=1361\" target=\"_blank\">recurso 1</a> y&nbsp; <a href=\"http://148.207.218.46/tecnologia/mod/h5pactivity/view.php?id=1374\" target=\"_blank\">recurso 2</a>) se pide en cursivas y así se ha manejado, por lo que en este caso, igual se dejo en cursivas.</p><p>Para que lo tomen en cuenta al momento de revisarlo.</p> <small>(Editado: 2023-09-27 11:03:22)</small> <small>(Editado: 2023-09-27 14:27:31)</small>', '63cb2a6d7f0fb3.85967578', '', '2023-09-27 14:27:31', '', '', 'mensaje', 0),
