(1343, 325, '<p>Buenas tardes Lau.</p><p>Te asigno el <a href=\"http://148.207.218.46/tecnologia/mod/h5pactivity/view.php?id=1373\" target=\"_blank\">recurso</a> para <a href=\"https://drive.google.com/file/d/11pmX9C_uEKuP5Ur6e_NcIvwmABB_iwYP/view?usp=drive_link\" target=\"_blank\">cotejo</a>.</p><p>Excelente tarde.<br></p> <small>(Editado: 2023-09-28 11:39:34)</small>', '63cb28a0adb2f2.67596660', '', '2023-09-28 11:39:34', '', '', 'mensaje', 0),
(1344, 293, '<p>Hola Lau, te comparto el <a href=\"https://drive.google.com/file/d/1fy5D5x2Cpp2glf2RqPbMQmb4XXjEj4lN/view?usp=drive_link\" target=\"_blank\">extenso de U3</a> para su cotejo. Se detectaron cuestiones de guion mientras se producia:</p><p>1. en la pagina 55 del PDF hay una instruccion con italicas, y en el guion viene en redondas, lo cual es un error, ya que las ham manejado en italicas.</p><p>2. la herramienta se llama Ilustraciones, pero en la pagina 62 colocaron ilustración en el guion, y por cuestio de unificar con las herramientas de la guia de navegación, se dejo Ilustraciones.</p><p>Si tienes alguna duda, quedo al pendiente.</p><p>Salduos :D</p> <small>(Editado: 2023-09-27 17:44:07)</small>', '63cb274b243f88.12842329', '', '2023-09-27 17:44:07', '', '', 'mensaje', 0),
(1345, 308, '<p>¡Hola, Lau!</p><p style=\"text-align: left; \">Comparto <a href=\"http://148.207.218.46/tecnologia/mod/page/view.php?id=1343\" target=\"_blank\">recurso</a> y <a href=\"https://drive.google.com/file/d/1tsg4WvgJCtuTNPBUe2Hk1sBNAGZuXqWB/view?usp=drive_link\" target=\"_blank\">PDF</a> para revisión. Te quería comentar que se hizo un cambio en la estructura del recurso producido. En el guion la Tabla 2 se cambio por un un interactivo por ello se elimino el nombre de la misma y su nota, en su lugar se agrego una instrucción de interactividad, estos ajustes fueron validados por el área académica pero<b> no</b> se ajusto el guion final por lo cual el recurso producido contra guión en ese punto no coincidirá, cualquier duda estaré pendiente . :D&nbsp;&nbsp;</p><p>Saludos</p> <small>(Editado: 2023-09-27 18:23:21)</small> <small>(Editado: 2023-09-27 18:24:34)</small> <small>(Editado: 2023-09-27 18:26:15)</small> <small>(Editado: 2023-09-27 18:27:15)</small> <small>(Editado: 2023-09-29 09:26:57)</small>', '63cb2915916798.85801765', '', '2023-09-29 09:26:57', '', '', 'mensaje', 0),
(1346, 303, '<p>Hola Nek, ya realicé la <a href=\"http://148.207.218.173/index.php/tareas/validacion_reporte?id=65&amp;id_revision=262&amp;fecha_revision=2023-09-27%2000:00:00&amp;tarea=303\" target=\"_blank\"><b><u>revisión de QA</u></b></a> y no se encontraron ajustes. Favor de aplicar los <a href=\"https://drive.google.com/file/d/1uy8Ly6Chnm1QXDsLWHUeHX-CbAtJQ6Y9/view\" target=\"_blank\"><b><u>comentarios de Abraham</u></b></a>. Sólo el nombre del recurso queda pendiente, ya lo consulté con Académico,&nbsp; para no detener más este proceso sugiero que siga avanzando y te informo del nombre en cuanto tenga información de ellos. Saludos</p>', '62a8a43bb67fa6.38495185', '', '2023-09-27 20:17:01', '', '', 'mensaje', 0),
