(1348, 330, '<p>Holi Mike, te comparto la <a href=\"http://148.207.218.173/index.php/tareas/validacion_reporte?id=65&amp;id_revision=263&amp;fecha_revision=2023-09-27%2000:00:00&amp;tarea=330\" target=\"_blank\"><b><u>revisión de QA</u></b></a>. Te comento que el H5P no se puede resolver en celular, por eso el parámetro \"<span style=\"font-family: &quot;Helvetica Neue&quot;; font-size: 13px; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Es robusto, se visualiza en distintos dispositivos y navegadores.\" no se cumple. Favor de aplicar el comentario de Laura sobre la ponderación, yo también lo noté. Saludos</span></p>', '62a8a43bb67fa6.38495185', '', '2023-09-27 21:12:46', '', '', 'mensaje', 0),
(1349, 296, '<p>Hola Nek, </p><p>Se ha finalizado la <a href=\"http://148.207.218.173/index.php/tareas/validacion_reporte?id=65&amp;id_revision=264&amp;fecha_revision=2023-09-27%2000:00:00&amp;tarea=296\" target=\"_blank\"><b><u>revisión de QA</u></b></a>. El único comentario es que el ícono de interactividad es diferente a otros recursos, por eso el parámetro \"<span style=\"font-family: &quot;Helvetica Neue&quot;; font-size: 13px; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Está alineado al diseño general, con el mismo estilo y tamaño.</span><span style=\"text-align: var(--bs-body-text-align);\"><span style=\"font-weight: var(--bs-body-font-weight);\">\" no se cumple. Favor de aplicar también los </span><a href=\"https://drive.google.com/file/d/1irz_mSwIj0mbPJ-hnoxv5dmKwEqkuwo7/view?usp=drive_link\" target=\"_blank\" style=\"\"><b><u>cambios de CE</u></b></a><span style=\"font-weight: var(--bs-body-font-weight);\">.</span></span></p><p><span style=\"text-align: var(--bs-body-text-align);\"><span style=\"font-weight: var(--bs-body-font-weight);\">Saludos</span></span></p>', '62a8a43bb67fa6.38495185', '', '2023-09-27 21:49:59', '', '', 'mensaje', 0),
